import React from 'react';
import { Route, Link, Redirect } from 'react-router-dom';

function ProtectedRoute({ isAuth: isAuth, component: Component, ...rest }) {
    return <Route {...rest} render={(props)=>{
        if(isAuth){
            return <Component/>
        }else{
            <Redirect to="/login"/>
        }
    }} />
}

export default ProtectedRoute
